var deDE={messages:{"'A Metamask error caused your wallet to disconnect. Reload the page to reconnect.'":"'A Metamask error caused your wallet to disconnect. Reload the page to reconnect.'","A signature is needed to trade this token on the Uniswap protocol. For security, signatures expire after 30 days.":"A signature is needed to trade this token on the Uniswap protocol. For security, signatures expire after 30 days.","Allow":"Erlauben","Allow in your wallet":"Lassen Sie es in Ihrer Brieftasche zu","Allow {symbol} first":["Lassen Sie zuerst ",["symbol"]," zu"],"Allowance pending":"Genehmigung ausstehend","An error occurred when trying to execute this swap. You may need to increase your slippage tolerance. If that does not work, there may be an incompatibility with the token you are trading. Note: fee on transfer and rebase tokens are incompatible with Uniswap V3.":"Beim Versuch, diesen Swap auszuführen, ist ein Fehler aufgetreten. Möglicherweise müssen Sie Ihre Schlupftoleranz erhöhen. Wenn dies nicht funktioniert, liegt möglicherweise eine Inkompatibilität mit dem Token vor, den Sie handeln. Hinweis: Gebühren für Transfer- und Rebase-Token sind nicht mit Uniswap V3 kompatibel.","Approval pending":"Bestätigung ausstehend","Approve":"Bestätigen","Approve Permit2":"Approve Permit2","Approve in your wallet":"Genehmigen Sie in Ihrer Brieftasche","Approve {0} for trading":["Approve ",["0"]," for trading"],"Approve {symbol} first":["Genehmigen Sie zuerst ",["symbol"]],"Auto":"Autom.","Auto Router":"Automatischer Router","Auto Router API":"Auto Router API","Balance:":"Guthaben:","Best price route costs {0} in gas. Your price is optimized by considering split routes, multiple hops, and gas costs.":["Best price route costs ",["0"]," in gas. Your price is optimized by considering split routes, multiple hops, and gas costs."],"Cancel":"Cancel","Close":"Schließen","Confirm in your wallet":"Bestätigen Sie in Ihrer Brieftasche","Confirming approval":"Confirming approval","Connect to {0}":["Connect to ",["0"]],"Connect wallet":"Wallet verbinden","Connecting…":"…","Continue":"Continue","Convert {0} to {1}":["Wandle ",["0"]," in ",["1"],"um"],"Convert {0} to {1} with no slippage":["Convert ",["0"]," to ",["1"]," with no slippage"],"Disconnect wallet":"Brieftasche trennen","Dismiss":"Verwerfen","Enter an amount":"Betrag eingeben","Error fetching trade":"Fehler beim Abrufen des Handels","Exchange rate":"Exchange rate","Expected output":"Expected output","Fetching best price…":"Abrufen des besten Preises…","Get support":"Get support","Gives you the ability to trade this token on the Uniswap protocol. For security, this will expire in 30 days.":"Gives you the ability to trade this token on the Uniswap protocol. For security, this will expire in 30 days.","High slippage increases the risk of price movement":"Eine hohe Slippage erhöht das Risiko von Preisbewegungen","I don't have a wallet":"Ich habe keine Brieftasche","Insufficient liquidity":"Insufficient liquidity","Insufficient {0} balance":["Unzureichendes ",["0"]," Guthaben"],"Invalid recipient":"Ungültiger Empfänger","Max":"Max.","Max slippage":"Max. Schlupf","Maximum input after slippage":"Maximum input after slippage","Minimum output after slippage":"Minimum output after slippage","Missing dependencies":"Fehlende Abhängigkeiten","Network fee":"Netzwerkgebühr","No results found.":"Keine Ergebnisse gefunden.","No tokens are available on this network. Please switch to another network.":"In diesem Netzwerk sind keine Token verfügbar. Bitte wechseln Sie zu einem anderen Netzwerk.","Order routing":"Order routing","Output is estimated. You will receive at least {minReceivedString} or the transaction will revert.":["Output is estimated. You will receive at least ",["minReceivedString"]," or the transaction will revert."],"Output is estimated. You will send at most {maxSentString} or the transaction will revert.":["Output is estimated. You will send at most ",["maxSentString"]," or the transaction will revert."],"Permit2 allows safe sharing and management of token approvals across different smart contracts.":"Permit2 allows safe sharing and management of token approvals across different smart contracts.","Permit2 approval failed":"Permit2 approval failed","Please enter a valid slippage %":"Bitte geben Sie eine gültige Slippage % ein","Powered by the Uniswap protocol":"Unterstützt durch das Uniswap-Protokoll","Price impact":"Preisauswirkung","Price updated":"Preis aktualisiert","Reload":"Reload","Reload the page":"Seite neu laden","Request rejected":"Request rejected","Review swap":"Bewertungstausch","Search by token name or address":"Suche nach Token-Name oder -Adresse","Select token":"Select token","Show less":"Show less","Show more":"Show more","Something went wrong":"Etwas ist schief gelaufen","Sorry, an error occured while processing your request. Please try again or contact support.":"Sorry, an error occured while processing your request. Please try again or contact support.","Success":"Erfolg","Swap":"Tauschen","Swap failed: {0}":["Tausch fehlgeschlagen: ",["0"]],"Switch network":"Netzwerk wechseln","Switch network in your wallet":"Wechseln Sie das Netzwerk in Ihrer Brieftasche","Switching network":"Netzwerk wechseln","Test Title":"Test Title","The Uniswap invariant x*y=k was not satisfied by the swap. This usually means one of the tokens you are swapping incorporates custom behavior on transfer.":"Die Uniswap-Invariante x*y=k wurde durch den Tausch nicht erfüllt. Dies bedeutet normalerweise, dass einer der Token, die Sie austauschen, ein benutzerdefiniertes Verhalten bei der Übertragung enthält.","The amount you expect to receive at the current market price. You may receive less or more if the market price changes while your transaction is pending.":"The amount you expect to receive at the current market price. You may receive less or more if the market price changes while your transaction is pending.","The estimated difference between the USD values of input and output amounts.":"The estimated difference between the USD values of input and output amounts.","The fee paid to miners to process your transaction. This must be paid in ETH.":"The fee paid to miners to process your transaction. This must be paid in ETH.","The impact your trade has on the market price of this pool.":"The impact your trade has on the market price of this pool.","The input token cannot be transferred. There may be an issue with the input token.":"Der eingegebene Token kann nicht übertragen werden. Möglicherweise liegt ein Problem mit dem Token vor.","The network is confirming your Permit2 approval before you can swap.":"The network is confirming your Permit2 approval before you can swap.","The output token cannot be transferred. There may be an issue with the output token.":"Der Ausgabe-Token kann nicht übertragen werden. Möglicherweise liegt ein Problem mit dem Token vor.","The output token cannot be transferred. There may be an issue with the output token. Note: fee on transfer and rebase tokens are incompatible with Uniswap V3.":"Das Ausgabetoken kann nicht übertragen werden. Möglicherweise liegt ein Problem mit dem Ausgabetoken vor. Hinweis: Gebühren für Transfer- und Rebase-Token sind nicht mit Uniswap V3 kompatibel.","There will be a large difference between your input and output values due to current liquidity.":"There will be a large difference between your input and output values due to current liquidity.","This error was prompted by denying a request in your wallet.":"This error was prompted by denying a request in your wallet.","This transaction could not be sent because the deadline has passed. Please check that your transaction deadline is not too low.":"This transaction could not be sent because the deadline has passed. Please check that your transaction deadline is not too low.","This transaction will not succeed due to price movement. Try increasing your slippage tolerance. Note: fee on transfer and rebase tokens are incompatible with Uniswap V3.":"Diese Transaktion wird aufgrund von Preisbewegungen nicht erfolgreich sein. Versuchen Sie, Ihre Schlupftoleranz zu erhöhen. Hinweis: Gebühren für Transfer- und Rebase-Token sind nicht mit Uniswap V3 kompatibel.","This transaction will not succeed either due to price movement or fee on transfer. Try increasing your slippage tolerance.":"Diese Transaktion wird nicht erfolgreich sein, entweder aufgrund von Preisbewegungen oder aufgrund von Gebühr-bei-Transfer. Versuchen Sie, Ihre Schlupftoleranz zu erhöhen.","This transaction will result in a":"This transaction will result in a","Transaction deadline":"Transaktionsfrist","Transaction rejected":"Transaktion abgelehnt","Transaction submitted":"Transaktion eingereicht","Try again":"Try again","Try increasing your slippage tolerance.<0/>NOTE: Fee on transfer and rebase tokens are incompatible with Uniswap V3.":"Versuchen Sie, Ihre Schlupftoleranz zu erhöhen.<0/>HINWEIS: Gebühren für Transfer- und Rebase-Token sind nicht mit Uniswap V3 kompatibel.","Unexpected error. Could not estimate gas for the swap.":"Unerwarteter Fehler. Gas für den Tausch konnte nicht geschätzt werden.","Unexpected issue with estimating the gas. Please try again.":"Unerwartetes Problem bei der Schätzung des Gases. Bitte versuche es erneut.","Use the Uniswap Labs API to get faster quotes.":"Use the Uniswap Labs API to get faster quotes.","View on Etherscan":"Auf Etherscan ansehen","Wallet disconnected":"Wallet disconnected","Warning":"Warnung","You pay":"You pay","You receive":"You receive","Your swap failed.":"Your swap failed.","Your swap was modified through your wallet. If this was a mistake, please cancel immediately or risk losing your funds.":"Your swap was modified through your wallet. If this was a mistake, please cancel immediately or risk losing your funds.","Your transaction will revert if it has been pending for longer than this period of time.":"Ihre Transaktion wird rückgängig gemacht, wenn sie länger als dieser Zeitraum aussteht.","Your transaction will revert if the price changes unfavorably by more than this percentage.":"Ihre Transaktion wird rückgängig gemacht, wenn sich der Preis ungünstig um mehr als diesen Prozentsatz ändert.","minutes":"Minuten","price impact on the market price of this pool. Do you wish to continue?":"price impact on the market price of this pool. Do you wish to continue?","{0} approval failed":[["0"]," approval failed"],"{0} {1}":[["0"]," ",["1"]],"{0}. Try increasing your slippage tolerance.\nNote: fee-on-transfer and rebase tokens are incompatible with Uniswap V3.":[["0"],". Try increasing your slippage tolerance.\nNote: fee-on-transfer and rebase tokens are incompatible with Uniswap V3."],"{caption}":[["caption"]],"{integrator} fee":[["integrator"]," Gebühr"],"{symbol} permit allowance failed: {0}":[["symbol"]," permit allowance failed: ",["0"]],"{symbol} token allowance failed: {0}":[["symbol"]," token allowance failed: ",["0"]],"{title}":[["title"]]}};

